.ranking-text {
	width: 345px;
	margin: 0 auto;
	margin-top: 11px;
	margin-bottom: 22px;
	display: flex;
	position: relative;
	p {
		&:nth-of-type(1) {
			font-size: 12px;
			color: #ff8a66;
		}
		&:nth-of-type(2) {
			font-size: 12px;
			color: rgba(0, 0, 0, 0.3);
			position: absolute;
			right: 0;
		}
	}
}
.ranking-list {
	width: 345px;
	margin: 0 auto;
	ul {
		width: 100%;
		li {
			display: flex;
			height: 40px;
			position: relative;
			margin: 10px 0;
			.list-index {
				width: 36px;
				height: 36px;
				display: flex;
				justify-content: center;
				align-items: center;
				p {
					font-size: 14px;
					color: rgba(0, 0, 0, 0.36);
				}
			}
			.list-img {
				width: 40px;
				height: 40px;
				border-radius: 50%;
				img {
					width: 100%;
					height: 100%;
					border-radius: 50%;
				}
			}
			.lsit-name {
				display: flex;
				justify-content: center;
				align-items: center;
				padding-left: 10px;
				p {
					font-size: 15px;
					color: rgba(0, 0, 0, 0.74);
					img {
						width: 14px;
						height: 14px;
					}
				}
			}
			.lsit-time {
				display: flex;
				align-items: center;
				margin-left: auto;
				p {
					font-family: Helvetica-Bold;
					font-size: 28px;
					color: #ff8a66;
				}
			}
		}
	}
}
.user-list {
	width: 100%;
	position: fixed;
	bottom: 0;
	margin: 0 auto;
	background: #fff;
	text-align: center;
	box-shadow: 0px -1px 16px 0px rgba(0, 0, 0, 0.12);
}
